import React, {Component} from 'react';
import { connect } from 'react-redux';
import NewMovieForm from '../NewMovieForm';
import { onNewMovieSubmit } from '../../actions/newMovie';

class NewMoviePage extends Component {
   constructor(props) {
     super(props);
     console.log('New Movies Page', props);
   }

    render(){
     return (
       <div>
         <h2>New Movie</h2>
          <NewMovieForm newMovie={this.props.newMovie} onNewMovieSubmit={this.props.onNewMovieSubmit}/>
       </div>
     );
  }
} 

const mapStateToProps =  ({ newMovie , movies}) => {
   return {
      newMovie
   }
};

const mapDispatchToProps = {
   onNewMovieSubmit
};

export default connect(mapStateToProps, mapDispatchToProps)(NewMoviePage);
